// src/components/CardOne.js
import React from 'react';

function CardOne() {
  return (
    <div className="flex flex-col h-full">
      <h2 className="text-xl font-bold mb-4">Create a Project</h2>
      <label>Project Name</label>
      <input type="text" className="mb-4 p-2 border rounded" placeholder="Enter project name" />

      <label>Client</label>
      <input type="text" className="mb-4 p-2 border rounded" placeholder="Enter client name" />

      <label>Start Date</label>
      <input type="date" className="mb-4 p-2 border rounded" />

      <label>End Date</label>
      <input type="date" className="p-2 border rounded" />
    </div>
  );
}

export default CardOne;
